import React, { useEffect } from "react";
import { useHistory } from "react-router-dom";

const StartPage = () => {
  const history = useHistory();

  useEffect(() => {
    const timer = setTimeout(() => {
      history.push("/tutor");
    }, 10000); 


    return () => clearTimeout(timer);
  }, [history]);

  return (
    <div>
      <h1>Redirecting in 10 seconds...</h1>
    </div>
  );
};

export default StartPage;
